import React from "react";

const Dashboard = () => {
  let count = 12;
  const handleClick = () => {
    count = count + 1;
  };
  return (
    <div className="flex justify-center items-center min-h-screen">
      <div className="border border-gray-300 bg-slate-100 shadow-md rounded px-8 pt-6 pb-8 mb-4">
        <table className="table-auto">
          <thead>
            <tr>
              <th className="px-4 py-2 text-gray-600">Title</th>
              <th className="px-4 py-2 text-gray-600">Author</th>
              <th className="px-4 py-2 text-gray-600">Count</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                Intro to CSS
              </td>
              <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                Adam
              </td>
            </tr>
            <tr>
              <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                A Long and Winding Tour of the History of UI Frameworks and
                Tools and Impact on the Design
              </td>
              <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                Adam
              </td>
              <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                {count}
              </td>
            </tr>
          </tbody>
        </table>
        <button onClick={handleClick}></button>
      </div>
    </div>
  );
};

export default Dashboard;
